function(){

	/* this code forces the list size of an autosized mode to return a specific number instead of calling calculateAutoListSize(). 
	* the purpose of this is to allow the ab-test of this mode to get enough recommendations. in case that this ab-test does not exist anymore,
	* also checks if abp is on and if so return zero items - remove the mode 
	* this code can be removed 
	*/ 
	this.origGetListSize = this.getListSize; 
	this.getListSize = function(m) { 
		if(m['mode'] == 'hybrid-thumbs-2r'){ 
			return 9; 
		} 
		else if(m['mode'] == 'hybrid-thumbs-1r' && TRC.blocker.blockedState == 1){ 
			return 0;
		} 
		return this.origGetListSize(m); 
	} 
	
	
	try{
		var rbox = window.TRC && TRC.implClasses && TRC.implClasses.TRCRBox;
			if (rbox && !TRC.publisherStartFlag) {
				TRC.publisherStartFlag = true;
				rbox.prototype.generateResponsiveOutersOriginal = rbox.prototype.generateResponsiveOuters;
				rbox.prototype.generateResponsiveOuters = 
					function(wrapper){
						if (this.mode_name === 'ab_thumbnails-b_row-above-pagination') {							
							var tagsContainer = document.querySelector('.box.pagination.current-prev-next'),
								taboolaContainer = document.querySelector('#taboola-below-article-thumbnails'),
								pageContent =   tagsContainer && taboolaContainer;
								if (pageContent && tagsContainer.style.display!='none') {
									var contentContainer = tagsContainer.parentNode;
									contentContainer.insertBefore(taboolaContainer,tagsContainer);
									taboolaContainer.style.margin=0;					
								}
						}
						if (this.mode_name === 'ab_thumbnails-a_above-pagination') {							
							var tagsContainer = document.querySelector('.box.pagination.current-prev-next'),
								taboolaContainer = document.querySelector('#taboola-mobile-below-article-thumbnails'),
								pageContent =  tagsContainer && taboolaContainer;
							if (pageContent && tagsContainer.style.display!='none') {
								var contentContainer = tagsContainer.parentNode;
								contentContainer.insertBefore(taboolaContainer,tagsContainer);
								taboolaContainer.style.margin=0;
							}
						}
						if (this.mode_name === 'ab_thumbnails-b_row-above-related-news') {							
							var tagsContainer = document.querySelector('.box.pagination.current-prev-next'),
								taboolaContainer = document.querySelector('#taboola-below-article-thumbnails'),
								pageContent =  tagsContainer && taboolaContainer;
								if (pageContent) {
									var contentContainer = tagsContainer.parentNode;
									tagsContainer.parentNode.insertBefore(taboolaContainer, tagsContainer.nextSibling);	
									taboolaContainer.style.margin=0;							
									}
						}
						if (this.mode_name === 'ab_thumbnails-b_above-related-news') {							
							var tagsContainer = document.querySelector('.box.pagination.current-prev-next'),
								taboolaContainer = document.querySelector('#taboola-below-article-thumbnails'),
								taboolaContainer2 = document.querySelector('#taboola-below-article-thumbnails-2nd'),
								pageContent =   tagsContainer && taboolaContainer && taboolaContainer2;
								if (pageContent) {
									var contentContainer = tagsContainer.parentNode;
									tagsContainer.parentNode.insertBefore(taboolaContainer2, tagsContainer.nextSibling);	
									tagsContainer.parentNode.insertBefore(taboolaContainer, tagsContainer.nextSibling);	
									taboolaContainer.style.margin=0;	
									taboolaContainer2.style.margin=0;					
								}
						}
						if (this.mode_name === 'ab_thumbnails-b_row-above-related-news') {							
							var tagsContainer = document.querySelector('.box.pagination.current-prev-next'),
								taboolaContainer = document.querySelector('#taboola-below-article-thumbnails'),
								taboolaContainer2 = document.querySelector('#taboola-below-article-thumbnails-2nd'),
								pageContent =  tagsContainer && taboolaContainer && taboolaContainer2;
								if (pageContent && tagsContainer.style.display!='none') {
									var contentContainer = tagsContainer.parentNode;	
									tagsContainer.parentNode.insertBefore(taboolaContainer, tagsContainer.nextSibling);		
									taboolaContainer.style.margin=0;		
									taboolaContainer2.style.margin=0;										
								}
						}			
						if (this.mode_name === 'ab_thumbnails-a_above-related-news') {							
							var tagsContainer = document.querySelector('.box.pagination.current-prev-next'),
								taboolaContainer = document.querySelector('#taboola-mobile-below-article-thumbnails'),
								pageContent =  tagsContainer && taboolaContainer;
								if (pageContent) {
									var contentContainer = tagsContainer.parentNode;
									tagsContainer.parentNode.insertBefore(taboolaContainer, tagsContainer.nextSibling);	
									taboolaContainer.style.margin=0;														
								}
						}
						if (this.mode_name === 'ab_thumbnails-b_above-pagination') {							
							var tagsContainer = document.querySelector('.box.pagination.current-prev-next'),
								taboolaContainer = document.querySelector('#taboola-below-article-thumbnails'),
								taboolaContainer2 = document.querySelector('#taboola-below-article-thumbnails-2nd'),
								pageContent =   tagsContainer && taboolaContainer && taboolaContainer2;
								if (pageContent && tagsContainer.style.display!='none') {
									var contentContainer = tagsContainer.parentNode;
									contentContainer.insertBefore(taboolaContainer,tagsContainer);
									contentContainer.insertBefore(taboolaContainer2,tagsContainer);
									taboolaContainer.style.margin=0;	
									taboolaContainer2.style.margin=0;					
								}
						}
						
						rbox.prototype.generateResponsiveOutersOriginal.call(this, wrapper);
					};
			}
		
	}
	catch(e){
	}
}



